import React from 'react';

const Stats = () => {
  return (
    <section className="estadisticas">
      <div className="stat">Seguidores: 609M</div>
      <div className="stat">Seguidos: 568</div>
      <div className="stat">Publicaciones: 3571</div>
    </section>
  );
}

export default Stats;
